      draw(){
        console.log(this.arr4)
        var self = this;
        var mycanvas = document.createElement('canvas');
        document.body.appendChild(mycanvas);
        // $('canvas').css('display','none');
        var len = self.arr2.image.length;
        mycanvas.width = 375;
        mycanvas.height = 564;
        if (mycanvas.getContext) {
          var context = mycanvas.getContext('2d');
          // 设置背景色
          context.fillStyle = '#fff';
          context.fill();
          context.fillRect(0, 0, mycanvas.width, mycanvas.height);
          context.beginPath();
          context.stroke();
          var h = 0;

          function drawing(num) {
            if (num < len) {
              var img = new Image;
              img.crossOrigin = "*";
              img.src = self.arr2.image[num];
              if (num == 0) {
                img.onerror = function () {
                  context.fillStyle = '#fff';
                  context.stokeStyle = '#dfdfdf';
                  context.fillRect(20, 20, 100, 100);
                  context.strokeRect(20, 20, 100, 100);
                  context.font = '24px 微软雅黑';
                  context.textAlign = 'center';
                  context.textBaseline = 'middle';
                  context.fillStyle = '#333';
                  context.fillText('LOGO', 70, 70);
                  drawing(num + 1);
                }
                img.onload = function () {
                  context.drawImage(img, 0, 0, mycanvas.width, mycanvas.height);
                  drawing(num + 1);
                }
              } else if (num == 1) {
                img.onerror = function () {
                  h = 140;
                  drawing(num + 1);
                }
                img.onload = function () {
                  context.drawImage(img, mycanvas.width - 250, mycanvas.height - 250, 200, 200);
                  drawing(num + 1);
                }
              }
            } else {
              self.imgPath = mycanvas.toDataURL("image/jpeg");
              document.getElementsByTagName('img')[0].src = self.imgPath;
            }
          }

          drawing(0);
        }
      },
      draw2(){
        console.log(this.arr4)
        var self = this;
        var mycanvas = document.createElement('canvas');
        document.body.appendChild(mycanvas);
        $('canvas').css('display', 'none');
        var len = self.arr4.length;
        mycanvas.width = 750;
        mycanvas.height = 1127;
        if (mycanvas.getContext) {
          var context = mycanvas.getContext('2d');
          // 设置背景色
          context.fillStyle = '#fff';
          context.fill();
          context.fillRect(0, 0, mycanvas.width, mycanvas.height);
          context.beginPath();
          context.stroke();
          var h = 0;

          function drawing(num) {
            if (num < len) {
              var img = new Image;
              img.crossOrigin = "*";
              img.src = self.arr4[num];
              if (num == 0) {
                img.onerror = function () {
                  drawing(num + 1);
                }
                img.onload = function () {
                  context.drawImage(img, 0, 0, mycanvas.width, mycanvas.height);
                  drawing(num + 1);
                }
              } else if (num == 1) {
                img.onerror = function () {
                  drawing(num + 1);
                }
                img.onload = function () {
                  context.drawImage(img, mycanvas.width / 2 - 60, 180, 120, 120);
                  drawing(num + 1);
                }
              } else if (num == 2) {
                console.log(self.arr4[num])
                context.font = 'bold 26px Microsoft YaHei';
                context.fillStyle = '#fff';
                context.textAlign = 'center';
                context.fillText(self.arr4[num], mycanvas.width / 2, 340);
                drawing(num + 1);
              } else if (num == 3) {
                console.log(self.arr4[num])
                context.font = '24px Microsoft YaHei';
                context.fillStyle = '#fff';
                context.textAlign = 'center';
                context.fillText(self.arr4[num], mycanvas.width / 2, 380);
                drawing(num + 1);
              } else if (num == 4) {
                img.onerror = function () {
                  drawing(num + 1);
                }
                img.onload = function () {
                  context.drawImage(img, mycanvas.width / 2 - 80, 650, 160, 160);
                  drawing(num + 1);
                }
              } else if (num == 5) {
                console.log(self.arr4[num])
                context.font = '24px Microsoft YaHei';
                context.fillStyle = '#fff';
                context.textAlign = 'center';
                context.fillText(self.arr4[num], mycanvas.width / 2, 860);
                drawing(num + 1);
              }
            } else {
              self.imgPath = mycanvas.toDataURL("image/jpeg");
              document.getElementsByTagName('img')[0].src = self.imgPath;
            }
          }

          drawing(0);
        }
      },
